angular.module('socialAppParent').run(['$templateCache', function($templateCache) {
  'use strict';

  $templateCache.put('views/apps/socialApp/default-card-style.html',
    "<div class=\"dynamic-layout-item\"><div class=\"card\"><a ng-if=\"it.image\" class=\"card-img-top-wrapper\" ng-style=\"{'padding-top': it.styleAttr + '%'}\" href=\"{{it.url}}\" target=\"_blank\"><img ng-style=\"{'margin-top': '-' + ( it.imgStyleAttr ? it.imgStyleAttr : 0 ) + '%'}\" class=\"card-img-top\" ng-src=\"{{it.image}}\"></a><div class=\"social-card-header\"><div class=\"post-link pull-left\"><a ng-href=\"{{externalScope().getPostUrl(it)}}\" target=\"_blank\"><i class=\"fa fa-{{it.service}}\"></i></a></div><div class=\"date\" ng-if=\"it.date\" class=\"social-date\" date=\"{{it.date}}\">{{it.date|date}}</div><div class=\"account\"><a target=\"_blank\" ng-href=\"{{ externalScope().getAccountUrl(it) }}\">{{ externalScope().getAccountTitle(it) }}</a></div></div><div class=\"card-block\" ng-if=\"it.text\"><h4 ng-if=\"it.title\" class=\"card-title\">{{it.title}}</h4><p class=\"card-text\" read-more words less-callback=\"externalScope().toggleText()\" more-callback=\"externalScope().toggleText()\" limit=\"40\" content=\"{{ externalScope().toSafe(it.text, it.service) }}\"></p></div></div></div>"
  );


  $templateCache.put('views/apps/socialApp/social-static.html',
    "<div ng-if=\"!socialHideControls\"><ul class=\"nav nav-pills\"><li class=\"social-filter-{{service}}\" ng-class=\"{active: isServiceActive('all')}\"><a class=\"text-gray\" ng-click=\"switchService($event, 'all')\" href=\"#\"><i class=\"fa fa-th\"></i></a></li><li ng-repeat=\"(service, obj) in services\" ng-show=\"showServiceTab(service)\" class=\"social-filter-{{service}}\" ng-class=\"{active: isServiceActive(service)}\"><a class=\"text-gray\" ng-click=\"switchService($event, service)\" href=\"#\"><i class=\"fa {{obj.icon}}\"></i><span class=\"sr-only\">{{obj.name}}</span></a></li></ul></div><div class=\"card-columns {{columnClasses}}\"><div ng-repeat=\"(key, item) in social track by item.id\" class=\"feed-type-{{item.service}} card\"><span class=\"img-top-buffer\"><a ng-if=\"item.image\" class=\"card-img-top-wrapper\" ng-style=\"{'padding-top': item.styleAttr + '%'}\" href=\"{{item.url}}\" target=\"_blank\"><img ng-style=\"{'margin-top': '-' + ( item.imgStyleAttr ? (item.imgStyleAttr + item.styleAttr) : item.styleAttr ) + '%'}\" class=\"card-img-top\" ng-src=\"{{item.image}}\"></a></span><div class=\"social-card-header\"><div class=\"post-link pull-left\"><a ng-href=\"{{getPostUrl(item)}}\" target=\"_blank\"><i class=\"fa fa-{{item.service}}\"></i></a></div><div class=\"date\" ng-if=\"item.date\" class=\"social-date\" date=\"{{item.date}}\">{{item.date|date}}</div><div class=\"account\"><a target=\"_blank\" ng-href=\"{{ getAccountUrl(item) }}\">{{ getAccountTitle(item) }}</a></div></div><div class=\"card-block\" ng-if=\"item.text\"><p class=\"card-text\" read-more words limit=\"40\" content=\"{{ toSafe(item.text, item.service) }}\"></p></div></div></div>"
  );


  $templateCache.put('views/apps/socialApp/social-timeline.html',
    "<div ng-if=\"!socialHideControls\"><ul class=\"nav nav-pills\"><li class=\"social-filter-{{service}}\" ng-class=\"{active: isServiceActive('all')}\"><a class=\"text-gray\" ng-click=\"timelineSwitchService($event, 'all')\" href=\"#\"><i class=\"fa fa-th\"></i></a></li><li ng-repeat=\"(service, obj) in services\" ng-show=\"showServiceTab(service)\" class=\"social-filter-{{service}}\" ng-class=\"{active: isServiceActive(service)}\"><a class=\"text-gray\" ng-click=\"timelineSwitchService($event, service)\" href=\"#\"><i class=\"fa {{obj.icon}}\"></i><span class=\"sr-only\">{{obj.name}}</span></a></li></ul></div><div class=\"now-feed clearfix\" ng-class=\"oddEvenSwitch ? 'item-left' : 'item-right'\"><div ng-repeat=\"(key, item) in social track by item.id\" class=\"feed-type-{{item.service}}\" data-date=\"{{getPublishedDate(item.date)}}\"><a class=\"feed-icon text-gray\" ng-href=\"{{getPostUrl(item)}}\" target=\"_blank\"><i class=\"fa {{services[item.service].icon}}\"></i></a><div class=\"card\"><a ng-if=\"item.image\" class=\"card-img-top-wrapper\" href=\"{{item.url}}\" ng-style=\"{'padding-top': item.styleAttr + '%'}\" target=\"_blank\"><img ng-style=\"{'margin-top': '-' + ( item.imgStyleAttr ? item.imgStyleAttr : 0 ) + '%'}\" class=\"card-image\" ng-src=\"{{item.image}}\"></a><div ng-if=\"item.text\" class=\"card-block\"><h6 ng-if=\"item.title\" class=\"card-title\" ng-bind-html=\"toSafe(item.title)\"></h6><p class=\"card-text\" read-more words limit=\"40\" content=\"{{ toSafe(item.text, item.service) }}\"></p><div ng-if=\"item.date\" class=\"social-date text-gray\" date=\"{{item.date}}\">{{item.date|date}}</div></div></div></div></div>"
  );


  $templateCache.put('views/apps/socialApp/social.html',
    "<div class=\"row\" ng-if=\"!socialHideControls\"><div class=\"col-xs-8\"><ul class=\"nav nav-pills\"><li class=\"social-filter-{{service}}\" ng-class=\"{active: isServiceActive('all')}\"><a class=\"text-gray\" ng-click=\"switchService($event, 'all')\" href=\"#\"><i class=\"fa fa-th\"></i></a></li><li ng-repeat=\"(service, obj) in services\" ng-show=\"showServiceTab(service)\" class=\"social-filter-{{service}}\" ng-class=\"{active: isServiceActive(service)}\"><a class=\"text-gray\" ng-click=\"switchService($event, service)\" href=\"#\"><i class=\"fa {{obj.icon}}\"></i><span class=\"sr-only\">{{obj.name}}</span></a></li></ul></div><div class=\"col-xs-4 text-right\"><!--\n" +
    "    <a class=\"btn btn-xs btn-default\" ng-click=\"recent()\">Recent</a>\n" +
    "    <a class=\"btn btn-xs btn-default\" ng-click=\"shuffle()\">Shuffle</a>\n" +
    "    --><a class=\"btn btn-default\" href=\"/contact\"><i class=\"fa fa-fw fa-comments\"></i> Connect with us &raquo;</a></div></div><div dynamic-layout items=\"social\"></div>"
  );

}]);
